Lib.Table={Matches=function(a,b)if type(a)~="table"or type(b)~="table"then return a==b end;for c,d in pairs(a)do if b[c]==nil then return false end;if type(d)=="table"then if not Lib.Table.Matches(d,b[c])then return false end else if d~=b[c]then return false end end end;for c,d in pairs(b)do if a[c]==nil then return false end;if type(d)=="table"then if not Lib.Table.Matches(d,a[c])then return false end else if d~=a[c]then return false end end end;return true end,Type=function(e)if not next(e)then return"empty"end;local f=true;local g=false;for c in pairs(e)do if type(c)~="number"then f=false;break else g=true end end;return f and"array"or(g and"mixed"or"object")end}